import React from "react";
import "./style.css";

export default function Search() {
  return (
    <form className="form">
      <label className="label" htmlFor="query">
        Movie Title <i className="fas fa-film"></i>
      </label>
      <input
        type="text"
        className="input"
        name="query"
        placeholder="i.e Fear Lake"
      ></input>
      <button className="button" type="submit">
        Search
      </button>
    </form>
  );
}
